import React from 'react';
import ReactDom from 'react-dom';
import './index.css'


const img1 = "https://picsum.photos/200/300/";
const img2 = "https://picsum.photos/400/300/";
const img3 = "https://picsum.photos/250/300/";
const img4 = "https://picsum.photos/300/300/";
const myWeb = "http://reyajul.zarss.com/";

ReactDom.render(
    <>
        <h1 className="heading">hey guys! now we started to learning react js</h1>
        <div className="images">
            <img src={ img1 } alt="..."/>
            <img src={ img3 } alt="..."/>
            <img src={ img4 } alt="..."/>
        </div>
        <a href={myWeb} target="_reyajul"><h1 className="heading">Reyajul Islam</h1></a>
    </>,
    document.getElementById('reyajul')
);
